import React from 'react';
import foto from '../images/Frame 19.png';


function Information() {
    return(
        <div id='features'>
         <div className='features-model'>
             <img src="https://wallpapercave.com/wp/wp4792731.jpg" alt='osmanhakan'/>
         </div>
         <div className='features-text'>
             <h2>What Are We Doing?</h2>
             <h3>We develop websites using many frameworks, we create front or back end sites as desired.</h3>
             <h2>Fast & Special</h2>
             <h3>You have the right to contact us at any time and get information about your project. We are ready to offer what you want in one go, without hurting the project areas.</h3>
             <h2>Just Want</h2>
             <h3>After your wishes, which are important to us, clearly state your wishes, leave the remaining work to us. Be confident that we will do the best for you.</h3>
         </div>
        </div>
    )
}

export default Information;
